ElectronDNNValidation::ElectronDNNValidation(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("/nfs/dust/cms/group/cms-llp/v6_calo_AOD/v6_calo_AOD_2017_E_resubmission_4_v5_ntuples/SingleElectronRun2017C-17Nov2017-v1/0000/output_2.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("/nfs/dust/cms/group/cms-llp/v6_calo_AOD/v6_calo_AOD_2017_E_resubmission_4_v5_ntuples/SingleElectronRun2017C-17Nov2017-v1/0000/output_2.root");
      }
      f->GetObject("tree",tree);

   }
   Init(tree);
}

ElectronDNNValidation::~ElectronDNNValidation()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t ElectronDNNValidation::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t ElectronDNNValidation::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

